import React, { useState, useEffect } from 'react';

const App = () => {
  const [apiData, setApiData] = useState(null);

  useEffect(() => {
    const fetchApiData = async () => {
      try {
        const response = await fetch('http://localhost:4000/api/ping/check-cctv');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        console.log('API Data:', data);
        setApiData(data.data);
      } catch (error) {
        console.error('Error fetching API data:', error);
      }
    };

    fetchApiData();
  }, []);

  return (
    <div>
      <h1>API Data</h1>
      {apiData ? (
        apiData.map(room => (
          <div key={room.room}>
            <h2>{room.room}</h2>
            <ul>
              {room.data.map(({ ipAddress, status }) => (
                <li key={ipAddress}>
                  IP Address: {ipAddress} - Status: {status}
                </li>
              ))}
            </ul>
          </div>
        ))
      ) : (
        <p>Loading API data...</p>
      )}
    </div>
  );
};

export default App;
